              name="brand"
              id="brand"
              value={brand}
              className="form-control"
              placeholder="Brand"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="model"
              id="model"
              className="form-control"
              value={model}
              placeholder="Model"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="serialNumber"
              id="serialNumber"
              className="form-control"
              value={serialNumber}
              placeholder="Serial Number"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="size"
              id="size"
              className="form-control"
              value={size}
              placeholder="Size"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="purchaseDate"
              id="purcaseDate"
              className="form-control"
              value={purchaseDate}
              placeholder="Purcase date"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="purchasePrice"
              id="purchasePrice"
              className="form-control"
              value={purchasePrice}
              placeholder="Purchase price"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="arrivalDate"
              id="arrivalDate"
              className="form-control"
              value={arrivalDate}
              placeholder="Arrival date"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="productCategory"
              id="productCategory"
              className="form-control"
              value={productCategory}
              placeholder="Product category"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div>
            <input
              type={"text"}
              name="saleValue"
              id="saleValue"
              value={saleValue}
              className="form-control"
              placeholder="saleValue"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <button
              type="submit"
              className="btn btn-success"
            >
              Salvar
            </button>
          </div>
        </form>
      </div>
    </div>
  );
  };
